import { Meteor } from 'meteor/meteor';
import React from 'react';
import ReactDOM from 'react-dom';

import Widget from './js/App';
import '.main.html';

Meteor.startup(function(){
  ReactDOM.render(<Widget/>, document.getElementById('fuck'));
});
